webpackJsonp([0xab6a83bbfb8],{910:function(a,n){a.exports={data:{post:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/posts/2018-04-24--VSCode-SFTP/index.md absPath of file >>> MarkdownRemark",html:'<p>こんにちは！</p>\n<p>普段開発エディターで <a href="https://code.visualstudio.com/">Visual Studio Code</a>を使ってます。</p>\n<p>今回は、<code class="language-text">VSCode</code>でSFTPファイル同期について紹介します ✈️</p>\n<br>\n<h1>SFTP拡張モジュールをインストール</h1>\n<p><a href="https://marketplace.visualstudio.com/items?itemName=liximomo.sftp">sftp - Visual Studio Marketplace</a> をインストールし、リロードします</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/img-1-325409a3683fb0fae2969d2ae9b39f89-99469.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-left: 0 !important; max-width: 321px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 88.78504672897196%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="img 1"\n        title=""\n        src="/static/img-1-325409a3683fb0fae2969d2ae9b39f89-99469.png"\n        srcset="/static/img-1-325409a3683fb0fae2969d2ae9b39f89-2dd35.png 200w,\n/static/img-1-325409a3683fb0fae2969d2ae9b39f89-99469.png 321w"\n        sizes="(max-width: 321px) 100vw, 321px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<br>\n<h1>設定</h1>\n<h2>1. 「shift + command + P」で<code class="language-text">SFTP</code>を入力</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/img-2-2fab7eb6e27c9992e68e1a7fdee54c76-7c2cb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-left: 0 !important; max-width: 475px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.26315789473684%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="img 2"\n        title=""\n        src="/static/img-2-2fab7eb6e27c9992e68e1a7fdee54c76-7c2cb.png"\n        srcset="/static/img-2-2fab7eb6e27c9992e68e1a7fdee54c76-9af64.png 200w,\n/static/img-2-2fab7eb6e27c9992e68e1a7fdee54c76-cdd49.png 400w,\n/static/img-2-2fab7eb6e27c9992e68e1a7fdee54c76-7c2cb.png 475w"\n        sizes="(max-width: 475px) 100vw, 475px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>2. <code class="language-text">SFTP:Config</code>をクリックし、設定ファイルを開く</h2>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code class="language-json"><span class="token punctuation">{</span>\n    <span class="token property">"protocol"</span><span class="token operator">:</span> <span class="token string">"sftp"</span><span class="token punctuation">,</span>\n    <span class="token property">"host"</span><span class="token operator">:</span> <span class="token string">"example.com"</span><span class="token punctuation">,</span>    // ホスト名\n    <span class="token property">"username"</span><span class="token operator">:</span> <span class="token string">"test-user"</span><span class="token punctuation">,</span>  // アクセスユーザー名\n    <span class="token property">"remotePath"</span><span class="token operator">:</span> <span class="token string">"/var/www/html/test_directory/"</span><span class="token punctuation">,</span>  // リモートするパス（絶対パス）\n    <span class="token property">"privateKeyPath"</span><span class="token operator">:</span> <span class="token string">"/Users/jslee/example/hoge.pem"</span><span class="token punctuation">,</span> // 鍵ファイルを指定\n    <span class="token property">"uploadOnSave"</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span> // ファイルを保存する時に、リモートサーバーにアップロード\n    <span class="token property">"downloadOnOpen"</span><span class="token operator">:</span> <span class="token boolean">false</span> // ファイルを開く時に、リモートサーバーからダウンロード\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>基本的な設定は以上になりますが、</p>\n<p>これ以外の設定は、<a href="https://marketplace.visualstudio.com/items?itemName=liximomo.sftp">sftp - Visual Studio Marketplace</a> 👈ここを参考にしてください。</p>',fields:{slug:"/VSCode-SFTP/",prefix:"2018-04-24"},frontmatter:{title:"【VSCode】SFTPでファイルを同期する",subTitle:"",cover:{childImageSharp:{resize:{src:"/static/vscode-logo-4f2a47209fdb18d70f0de6c876397ef4-160fa.png"}}}}},author:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>jslee</strong> <br>\n福岡在住外国籍WEBエンジニア👋 <br>\nPHPやVue.js、Angularなど書いてます！ 無類のラーメン好き🍜</p>"},footnote:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li><a href="../">lighthouse.log</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"152072888976323"}}}},pathContext:{slug:"/VSCode-SFTP/"}}}});
